import "./App.css";
import Board from "react-trello";

const data = {
  lanes: [
    {
      id: "lane1",
      title: "Planned Tasks",
      label: "2/2",
      cards: [
        {
          id: "Card1",
          title: "Write Blog",
          description: "Can AI make memes",
          label: "30 mins",
        },
        {
          id: "Card2",
          title: "Pay Rent",
          description: "Transfer via NEFT",
          label: "5 mins",
          metadata: { sha: "be312a1" },
        },
      ],
    },
    {
      id: "lane2",
      title: "Completed",
      label: "0/0",
      cards: [],
    },
    {
      id: "lane3",
      title: "Completed",
      label: "0/0",
      cards: [],
    },
  ],
};

function App() {
  return (
    <div className="App">
      <h1>Stevens Duck Planner</h1>
      <Board data={data} />
    </div>
  );
}

export default App;
